import './App.css';
import amazon from './assets/amazon.png'
import { Switch, FormControlLabel, FormGroup,Container, Typography, Toolbar, AppBar } from '@material-ui/core';
function App() {
  return (
    <Container maxWidth ="lg">
    <AppBar>
    <Toolbar>
    <Typography varient="body">
    Get Started
    </Typography>
    </Toolbar>
    </AppBar>
    <img src ={amazon} className="img" alt="No Preview"/>
    <Typography variant="h4" className="title" >Our Pricings</Typography>
    <FormGroup>
        <FormControlLabel
          control={<Switch checked={auth}  aria-label="login switch" />}
          label={auth ? 'Logout' : 'Login'}
        />
      </FormGroup>
    </Container>
  );
}

export default App;
